INSERT INTO Skill VALUES ('2.A.1.a', 'Reading Comprehension', 'Reading comprehension is the ability to process text, understand its meaning, and to integrate with what the reader already knows.', 'advanced');
INSERT INTO Skill VALUES ('2.A.1.b', 'Active Listening', 'Active listening is a technique that is used in counseling, training, and solving disputes or conflicts.', 'advanced');
INSERT INTO Skill VALUES ('2.A.1.c', 'Writing', 'Writing is a medium of human communication that involves the representation of a language with symbols.', 'advanced');
INSERT INTO Skill VALUES ('2.A.1.d', 'Speaking', 'Public speaking is the process or act of performing a speech to a live audience.', 'advanced');
INSERT INTO Skill VALUES ('2.A.1.e', 'Mathematics', 'Mathematics is the study of numbers, shapes and patterns.', 'beginner');
INSERT INTO Skill VALUES ('2.A.1.f', 'Science', 'Science (from the Latin word scientia, meaning "knowledge") is a systematic enterprise that builds and organizes knowledge by virtue of testable explanations and predictions about the universe.', 'medium');
INSERT INTO Skill VALUES ('2.A.2.a', 'Critical Thinking', 'Critical thinking is the analysis of facts to form a judgment. The subject is complex, and several different definitions exist, which generally include the rational, skeptical, unbiased analysis, or evaluation of factual evidence.', 'beginner');
INSERT INTO Skill VALUES ('2.A.2.b', 'Active Learning', 'Active learning is a method of learning in which students are actively or experientially involved in the learning process and where there are different levels of active learning, depending on student involvement.', 'medium');
INSERT INTO Skill VALUES ('2.A.2.c', 'Learning Strategies', 'Learning strategies are the different approaches and methods that humans use to enhance learning.', 'beginner');
INSERT INTO Skill VALUES ('2.A.2.d', 'Monitoring', 'Employee Monitoring is the act of employers surveying employee activity through different surveillance methods.', 'advanced');
INSERT INTO Skill VALUES ('2.B.1.a', 'Social Perceptiveness', 'Social perception (or person perception) is the study of how people form impressions of and make inferences about other people as sovereign personalities.', 'advanced');
INSERT INTO Skill VALUES ('2.B.1.b', 'Coordination', 'The act of coordinating, making different people or things work together for a goal or effect.', 'medium');
INSERT INTO Skill VALUES ('2.B.1.c', 'Persuasion', 'In business, persuasion is a process aimed at changing a person''s attitude or behaviour toward some event, idea, object, or other person(s), by using written, spoken words or visual tools to convey information, feelings, or reasoning, or a combination thereof.', 'beginner');
INSERT INTO Skill VALUES ('2.B.1.d', 'Negotiation', 'Negotiation is a dialogue between two or more people or parties intended to reach a beneficial outcome over one or more issues where a conflict exists with respect to at least one of these issues.', 'advanced');
INSERT INTO Skill VALUES ('2.B.1.e', 'Instructing', 'The act of instructing, teaching, or furnishing with information or knowledge.', 'advanced');
INSERT INTO Skill VALUES ('2.B.1.f', 'Service Orientation', 'Service-orientation is a design paradigm for computer software in the form of services.', 'medium');
INSERT INTO Skill VALUES ('2.B.2.i', 'Complex Problem Solving', 'Problem solving consists of using generic or ad hoc methods in an orderly manner to find solutions to problems.', 'advanced');
INSERT INTO Skill VALUES ('2.B.3.a', 'Operations Analysis', 'Operations Analysis is a discipline that deals with the application of advanced analytical methods to help make better decisions.', 'medium');
INSERT INTO Skill VALUES ('2.B.3.b', 'Technology Design', 'The study, design, development, application, implementation, support and management of computer and non-computer based technologies for the express purpose of communicating product design intent and constructability.', 'beginner');
INSERT INTO Skill VALUES ('2.B.3.c', 'Equipment Selection', 'Identifying and procuring suitable equipment.', 'medium');
INSERT INTO Skill VALUES ('2.B.3.d', 'Installation', ' Installation refers to the particular configuration of a software or hardware with a view to making it usable with the computer.', 'beginner');
INSERT INTO Skill VALUES ('2.B.3.e', 'Programming', 'Computer programming is the process of designing and building an executable computer program to accomplish a specific computing result or to perform a specific task.', 'medium');
INSERT INTO Skill VALUES ('2.B.3.g', 'Operation Monitoring', 'The continuous assessment of programmes based on early detailed information on the progress or delay of the ongoing assessed activities.', 'medium');
INSERT INTO Skill VALUES ('2.B.3.h', 'Operation and Control', 'The area of management concerned with designing and controlling the process of production and redesigning business operations in the production of goods or services.', 'advanced');
INSERT INTO Skill VALUES ('2.B.3.j', 'Equipment Maintenance', 'Equipment maintenance is any process used to keep a businesss equipment in reliable working order.', 'advanced');
INSERT INTO Skill VALUES ('2.B.3.k', 'Troubleshooting', 'Troubleshooting is a form of problem solving, often applied to repair failed products or processes on a machine or a system.', 'medium');
INSERT INTO Skill VALUES ('2.B.3.l', 'Repairing', 'The ability to restore equipment to full working functionality.', 'medium');
INSERT INTO Skill VALUES ('2.B.3.m', 'Quality Control Analysis', 'Quality control (QC) is a process by which entities review the quality of all factors involved in production. ISO 9000 defines quality control as "A part of quality management focused on fulfilling quality requirements".', 'advanced');
INSERT INTO Skill VALUES ('2.B.4.e', 'Judgment and Decision Making', 'The cognitive process resulting in the selection of a belief or a course of action among several possible alternative options, it could be either rational or irrational.', 'advanced');
INSERT INTO Skill VALUES ('2.B.4.g', 'Systems Analysis', 'The process of studying a procedure or business in order to identify its goals and purposes and create systems and procedures that will achieve them in an efficient way', 'medium');
INSERT INTO Skill VALUES ('2.B.4.h', 'Systems Evaluation', 'The systematic method for collecting, analyzing, and using information to answer questions about projects, policies and programs, particularly about their effectiveness and efficiency.', 'medium');
INSERT INTO Skill VALUES ('2.B.5.a', 'Time Management', 'Time management is the process of planning and exercising conscious control of time spent on specific activities, especially to increase effectiveness, efficiency, and productivity.', 'advanced');
INSERT INTO Skill VALUES ('2.B.5.b', 'Management of Financial Resources', 'Financial management may be defined as the area or function in an organization which is concerned with profitability, expenses, cash and credit, so that the "organization may have the means to carry out its objective as satisfactorily as possible;" the latter often defined as maximizing the value of the firm for stockholders.', 'beginner');
INSERT INTO Skill VALUES ('2.B.5.c', 'Management of Material Resources', 'Materials management is a core supply chain function and includes supply chain planning and supply chain execution capabilities.', 'advanced');
INSERT INTO Skill VALUES ('2.B.5.d', 'Management of Personnel Resources', 'Human Resource Management (HRM or HR) is the strategic approach to the effective management of people in a company or organization such that they help their business gain a competitive advantage.', 'beginner');
