INSERT INTO Position VALUES ('41-1011.00', 'First-Line Supervisors of Retail Sales Workers', 'Directly supervise and coordinate activities of retail sales workers in an establishment or department. Duties may include management functions, such as purchasing, budgeting, accounting, and personnel work, in addition to supervisory duties.', 93978, 65784.6);
INSERT INTO Position VALUES ('41-1012.00', 'First-Line Supervisors of Non-Retail Sales Workers', 'Directly supervise and coordinate activities of sales workers other than retail sales workers. May perform duties such as budgeting, accounting, and personnel work, in addition to supervisory duties.', 162919, 114043.3);
INSERT INTO Position VALUES ('41-2011.00', 'Cashiers', 'Receive and disburse money in establishments other than financial institutions. May use electronic scanners, cash registers, or related equipment. May process credit or debit card transactions and validate checks.', 159225, 111457.5);
INSERT INTO Position VALUES ('41-2012.00', 'Gaming Change Persons and Booth Cashiers', 'Exchange coins, tokens, and chips for patrons'' money. May issue payoffs and obtain customer''s signature on receipt. May operate a booth in the slot machine area and furnish change persons with money bank at the start of the shift, or count and audit money in drawers.', 136512, 95558.4);
INSERT INTO Position VALUES ('41-2021.00', 'Counter and Rental Clerks', 'Receive orders, generally in person, for repairs, rentals, and services. May describe available options, compute costs, and accept payment.', 139708, 97795.6);
INSERT INTO Position VALUES ('41-2022.00', 'Parts Salespersons', 'Sell spare and replacement parts and equipment in repair shop or parts store.', 114277, 79993.9);
INSERT INTO Position VALUES ('41-2031.00', 'Retail Salespersons', 'Sell merchandise, such as furniture, motor vehicles, appliances, or apparel to consumers.', 108597, 76017.9);
