-- PurchasePaymentRecord


-- For some reason the data generator I was using couldn't coerce CSV
-- values to floats, so this UPDATE statement inserts the intended
-- amounts for the purchase payment records

UPDATE  PurchasePaymentRecord
SET     amount = amount * 
        (SELECT     unit_cost
         FROM       Purchase
         WHERE      pur_num = pur_num);

